INSERT INTO `wz_oxdata` VALUES ('2', '1', 'You\'ll need 15 tree branches to make 1 Processed Wood. ', '10 tree branches is enough.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '2', 'You\'ll make a set of screws, 15 screws in total, with a Bronze Plate and a Steel Plate.', 'Screws are useful for making or upgrading items.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '3', 'Fusion Mace, a one-handed blunt weapon, is only available to Warriors and Magicians.', 'It\'s only available to Warriors and Magicians.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '4', 'Mace, a one-handed blunt weapon, is only available to Warriors and Magicians.', 'Mace is only available to Warriors and Magicians.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '5', 'Long Sword, a one-handed sword, is available to everyone BUT the beginners.', 'Beginners can use it, too.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '6', 'Balanche, a weapon for Bowman sold at Henesys, has an item option of STR + 2 attached to it.', 'Balanche has an item option of STR + 1 attached to it.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '7', 'The One-side Only Earring is available through stores, but NOT the Amethyst Earring.', 'Amethyst Earring can be purchased at the Henesys Department Store.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '8', 'The Blue Whitebottom Shoes that can be worn from LV. 26 on, is available to everyone, including the beginners.', 'It is available to everyone.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '9', 'The Armor Scroll consists of two types - the one for DEF, and the one for HP.', 'You can check through the Perion Department Store.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '10', 'When purchasing a 100% scroll at the store, the scroll for two-handed weapon is more expensive than the one for one-handed weapon.', 'The price for the scrolls for both the two-handed or one-handed weapon are the same.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '11', 'The weapon store at Ellinia only sells scrolls for Staff and Wand.', 'The scrolls for earrings are also available.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '12', 'The weapon store at Lith Harbor is the only place without the Subi Throwing-Star.', 'The Subi Throwing-Star is also available at Lith Harbor.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '13', 'The Stolen Fence is only available at Lith Harbor.', 'The Square Wooden Shield is available at Lith Harbor.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '14', 'The item options for the White & Black Korean Rubber Shoes are diferent.', 'The colors are different, but the options are the same.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '15', 'If you use the 100% Scroll for Claw for ATT, then the ATT will be +1, as will be the accuracy.', 'Only the ATT goes up by 1. The accuracy stays the same.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '16', 'A single item slot can hold upto 100 ores of same kind at once.', 'The ores can be stored up to 100 per slot.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '17', 'The item that\'s dropped onto the field will not disappear, even after a long period of time.', 'It disappears after a certain amount of time.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '100', 'To make the Mithril Tower Shield, you\'ll need Steel Tower Shield, 10 Mithril Plates, and 50,000 mesos.', 'Not 50,000 mesos, but 100,000 mesos.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '101', 'To make the Moon Rock, you\'ll need to take the a Plate of Mithril, Steel, Bronze, Adamantium, Silver, Orihalcon, and Gold each at Arwen the Fairy.', 'You also need 10,000 mesos along with the items.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '102', 'To make the Mithril Brist, you\'ll need Steel Brist, 5 Mithril Plates, and 55,000 mesos.', 'Mr. Smith of Perion makes it.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '103', 'Steel Pride, a hat for Magicians, has the item option of INT + 1 and LUK + 1', 'Only INT + 1 is available.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '104', 'To make Steel Trigger, which can be worn at LV. 30 for Warriors, you\'ll need 30 pieces of Drake\'s Skin.', 'It\'ll take 30 leathers and 20 pieces of Drake\'s Skin.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '105', 'Green Jack Boots, which is available for Bowman over LV. 25, has the item option of DEX + 2', 'An option of DEX + 1 is attached to it.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '106', 'Blue White-Lined Boots, which is available for thieves over LV. 35, has the item option of LUK + 1 and DEX + 1.', 'It\'s available through Chrishrama of Sleepywood.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '107', 'To make Metal Koif, a helmet for Warriors, you\'ll need a Bronze Koif, a Steel Plate, and 500 mesos.', 'Mr. Thunder of Perion makes it.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '108', 'To make Green Diros, a glove for Bowman, you\'ll need Red Diros as one of the materials.', 'Not Red Diros, but Blue Diros.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '109', 'To make the Basic Archer Glove, you\'ll need 20 leathers.', 'To make the Basic Archer Glove, you\'ll need 15 leathers.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '110', 'To make Work Glove, a glove for thieves, you\'ll need 20 leathers and 1,000 mesos.', 'You need 15 leathers and 1,000 mesos.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '111', 'To make Dark Wolfskin, a Thief glove, you\'ll need Steel Wolfskin as one of the materials.', 'Not Steel Wolfskin, but Bronze Wolfskin.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '112', 'To make Steel Titans, a claw for thieves, you\'ll need 5 screws as one of the materials. ', 'JM from tha Streetz of Kerning City makes it.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '113', 'To make Steel Igor, a claw for thieves, you\'ll need Bronze Igor, 2 Steel Plates, and 3,000 mesos. ', 'JM from tha Streetz of Kerning City makes it.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '114', 'To make Red Lutia, a glove for Magicians, you\'ll need 60 leathers.', 'Francois of Ellinia makes it.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '115', 'Dark Arten, a glove for Magicians, has the item option of INT + 2 and LUK + 1.', 'The only option attached to it is INT + 3.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '116', 'The level limit for Juno, a glove for Warriors, is 15.', 'The level limit is 10.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '117', 'To make Yellow Briggon, a glove for Warriors, you\'ll need 2 Topaz\'s.', 'Not 2, but 3 Topaz\'s', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '118', 'All weapons that can be used by everyone are only limited by levels, not stats.', 'There are weapons that are affected by the stats.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '119', 'To make Bronze Husk, a glove for Warriors, you\'ll need 2 Power Crystals as one of the materials.', 'An option of STR + 2 is attached to it.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '120', 'Snowshoes, which enables you not to slip through snow, is available to everyone with the level limit of 30.', 'The boots differ from different jobs.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '121', 'To make a crossbow called Rower, you\'ll need 45 screws.', 'You need 40 screws.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '122', 'The most expensive one to refine is the Star Rock.', 'The most expensive one to refine is Dark Crystal, which will cost you 50,000 mesos.', 'x');
INSERT INTO `wz_oxdata` VALUES ('2', '123', 'At the Repair Shop, you\'ll be able to acquire a Steel Plate with 100 pieces of Iron Hog\'s Metal Hoof and 1,000 mesos.', 'The Repair Shop is at Kerning City.', 'o');
INSERT INTO `wz_oxdata` VALUES ('2', '124', 'The Bronze Arrows and Steel Arrows are available through Vicious of Henesys.', 'Vicious only makes Bronze Arrows.', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '1', 'You get 5 mesos for selling one Mushroom Spore.', 'You get 3 mesos for selling one Mushroom Spore.', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '2', 'Slime Bubble costs more than the Squishy Liquid.', 'Slime Bubble DOES cost more than the Squishy Liquid.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '3', 'You get 100 mesos for selling 1 ore of Bronze.', 'You get 100 mesos for selling 1 ore of Bronze.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '4', 'Drake\'s Skull from Red Drake costs more than the Drake\'s Skull of other Drakes.', 'They all cost the same.', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '5', 'To refine one Black Crystal, it\'ll cost you 3,000 mesos.', 'It costs 3,000 mesos to refine a black crystal.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '6', 'You get 8 mesos for selling one Orange Mushroom Cap.', 'You get 4 mesos for selling one Orange Mushroom Cap.', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '7', 'You get 50 mesos for selling 10 tree branches.', 'You get 4 mesos for selling 1 tree branch.', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '8', 'You get 300 mesos for selling 3 leathers.', 'You get 100 mesos for selling 1 leather.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '9', 'The price of 10 ores of Gold and one Gold Plate is of same price.', 'You\'ll get 3,000 mesos for selling 10 ores of Gold, 1,200 mesos for a Gold Plate.', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '10', 'The most expensive Return Scroll is the one to Sleepywood.', 'The Return Scroll : Sleepywood costs 600 mesos.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '11', 'Sell 5 of Malady\'s Experiemental Frogs, buy Arrows for Bow, sell them back to the store, and you\'ll get 300 mesos.', 'You don\'t get anything for selling arrows at the store. Doesn\'t that blow?', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '12', 'To purchase [Old Wisconsin], you\'ll need 3,000 mesos.', '[Old Wisconsin] is available through the weapon store at Henesys.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '13', 'If you purchase Arrow for Bow at the store, it\'ll cost you 1 meso per arrow, but you won\'t be able to sell the arrows for any money.', 'Arrow for Bow and Crossbow will not get you any money for selling them at the store.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '14', 'The Watermelon at MapleStory costs 3,100 mesos.', 'It costs 3,200 mesos.', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '15', 'The Red Bean Sundae at MapleStory costs 4,000 mesos.', 'You can buy it from an NPC for 4,000 mesos.', 'o');
INSERT INTO `wz_oxdata` VALUES ('3', '16', 'The Ice Cream Suckers at MapleStory costs 2,100 mesos.', 'It costs 2,300 mesos.', 'x');
INSERT INTO `wz_oxdata` VALUES ('3', '17', 'The price of 150 Huge Bubbles of Bubbling is LOWER than 200 Slime Bubbles.', '200 Slime Bubbles : 10,000 mesos. 150 Huge Bubbles of Bubbling : 1,500 mesos.', 'o');
